import React from 'react';
import './Admin-login.css'; // Make sure to import your CSS file

const LoginPage = () => {
  return (
    <div className="box-form">
      <div className="left">
        <div className="overlay">
          <h1>NSS</h1>
          <h5>NOT ME BUT YOU !</h5>
        </div>
      </div>  
    </div>
  );
};

export default LoginPage;
